  constructor(props){
    super(props)
    this.state = {
      date:'',
      timeFrom:'',
      timeTo:'',
      patientType:'',
      equipmentUsed:'',
      problems:'bare masse problemer her. bruker denne til Ã¥ se hvordan multiline fungerer',
      status:'',
      data: [],
      };
    };

  componentDidMount() {
    console.log("oldreport: ", this.props.data);

    for(var i = 0; i < this.props.data.dataValues.length; i++){
